import React from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { Divider } from '@material-ui/core/Divider';
import ReactDOM from 'react-dom'

class NestedList extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            member : this.props.things
        }
        this.componentMount = this.componentMount.bind(this);
    }

    componentMount(e) {
        console.log(this.props);
        this.props.finalResult(e.target.innerText);
    
    }

  render() {
      return(
     <div onClick = {this.componentMount}>     
     {this.props.things.length === 0 ? console.log("hiding") :  
    <List component="nav" style = {{width : '20%', position : 'fixed' , left : "37.3%", border: "1px",boxShadow: "1px 1px 1px 1px #888888", borderRadius:"4px", maxHeight:"30%", overflow:"scroll", overflowX:"hidden"}}>
     {  this.props.things.map(row => (<ListItem style = {{textAlign : "center"}} button>
      <ListItemText primary = {`${row['1. symbol']}`} />
    </ListItem>))}
  </List>}
  </div>)
}
}

export default NestedList;
